static std::vector<float> sineWavetable() {
    int length = 1024;
    std::vector<float> w = std::vector<float>(length);
    
    const auto PI = std::atanf(1.f) * 4;
    
    for (auto i = 0; i<length; i++) {
        w[i] = std::sinf((2 * PI * static_cast<float>(i) / static_cast<float>(length)) - (PI / 2));
    }
    return w;
}

static std::vector<float> sawWavetable() {
    int length = 1024;
    std::vector<float> w(length);
    float inc = 1.f / static_cast<float>(length);
    float mod = 0;
    float height = 1.0;
    bool rising = true;
    for (auto i = 0; i<length; i++) {
        float sample = 0.0;
        if(mod > 1.0 - inc) {
            float t = (mod - 1.0) / inc;
            sample = height * (t*t + 2.0*t + 1.0);
            mod -= 1.0;
        }
        else if(mod < inc) {
            float t = mod / inc;
            sample = height * (2.0*t - t*t - 1.0);
        }
        else {
            sample = 2.0 * mod - 1.0;
        }
        if(!rising) {
            sample *= -1.0;
        }
        mod += inc;
        w[i] = sample;
    }
    return w;
}

